import React, { Component } from "react";
import Talent from "./Talent";

export default class TalentTable extends Component {
  render() {
    return (
      <div className="container">
        <table className="table">
          <thead>
            <tr>
              <th scope="col">Level</th>
              <th scope="col">Talent 1</th>
              <th scope="col">Talent 2</th>
              <th scope="col">Talent 3</th>
              <th scope="col">Talent 4</th>
              <th scope="col">Talent 5</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <th scope="row">1</th>
              {this.props.randomHero.talents[1].map(talent => (
                <Talent
                  talent={talent.icon}
                  onRandomButton={this.props.handleRandomButton}
                  randomHero={this.props.randomHero}
                />
              ))}
            </tr>

            <tr>
              <th scope="row">4</th>
              {this.props.randomHero.talents[1].map(talent => (
                <Talent
                  talent={talent.icon}
                  onRandomButton={this.props.handleRandomButton}
                  randomHero={this.props.randomHero}
                />
              ))}
            </tr>

            <tr>
              <th scope="row">7</th>
              {this.props.randomHero.talents[1].map(talent => (
                <Talent
                  talent={talent.icon}
                  onRandomButton={this.props.handleRandomButton}
                  randomHero={this.props.randomHero}
                />
              ))}
            </tr>

            <tr>
              <th scope="row">10</th>
              {this.props.randomHero.talents[1].map(talent => (
                <Talent
                  talent={talent.icon}
                  onRandomButton={this.props.handleRandomButton}
                  randomHero={this.props.randomHero}
                />
              ))}
            </tr>

            <tr>
              <th scope="row">13</th>
              {this.props.randomHero.talents[1].map(talent => (
                <Talent
                  talent={talent.icon}
                  onRandomButton={this.props.handleRandomButton}
                  randomHero={this.props.randomHero}
                />
              ))}
            </tr>

            <tr>
              <th scope="row">16</th>
              {this.props.randomHero.talents[1].map(talent => (
                <Talent
                  talent={talent.icon}
                  onRandomButton={this.props.handleRandomButton}
                  randomHero={this.props.randomHero}
                />
              ))}
            </tr>

            <tr>
              <th scope="row">20</th>
              {this.props.randomHero.talents[1].map(talent => (
                <Talent
                  talent={talent.icon}
                  onRandomButton={this.props.handleRandomButton}
                  randomHero={this.props.randomHero}
                />
              ))}
            </tr>
          </tbody>
        </table>
        <button
          type="button"
          className="btn btn-primary"
          onClick={this.props.onRandomButton}
        >
          Start
        </button>
      </div>
    );
  }
}
